INSERT INTO Evento (IDEmpresa, Preco, NomeEvento, Descricao, Categoria, HoraEvento, DataEvento)
VALUES
	(1, 26.00, 'Noite Intergaláctica de Jazz Cósmico', 'Em uma atmosfera única, este evento transporta os amantes do jazz para uma jornada intergaláctica. Com músicos talentosos vestidos como exploradores espaciais, o palco se transforma em uma nave interestelar, levando a plateia a uma experiência musical que transcende as fronteiras do universo conhecido.', 'Música', '19:00:00', '2024-08-13'),
	(2, 28.00, 'Festival de Comédia Aquática','Rindo até se afogar de tanto rir! Este festival único acontece em um teatro subaquático, onde comediantes habilidosos fazem performances hilárias enquanto nadam entre o público. As piadas e as risadas ecoam sob a água, criando uma atmosfera única de diversão aquática.', 'Comédia','18:30:00', '2024-01-15'),
	(3, 19.00, 'Braga Cup', ' O Braga Cup é um torneio de futebol infantil, que conta reunir uma centena de equipas e mais de 1.800 jogadores, treinadores e dirigentes em Braga', 'Futebol', '10:00:00', '2024-02-09'),
	(3, 10.00 , 'Braga Open' , 'O Braga Open é um torneio tênis, que faz parte da série ATP Challenger Tour', 'Ténis', '09:00:00', '2024-03-24'),
	(3, 15.00, 'Exposição de Arte Urbana', 'Uma exibição única de artistas urbanos contemporâneos. As paredes se tornam telas e os grafites ganham vida, proporcionando uma experiência visual impressionante.', 'Arte', '16:00:00', '2024-05-07'),
	(4, 20.50, 'Conferência de Inovação Tecnológica', 'Os líderes da indústria se reúnem para discutir as últimas tendências e inovações tecnológicas. Palestras inspiradoras, demonstrações ao vivo e oportunidades de networking.', 'Tecnologia', '14:30:00', '2024-06-19'),
	(4, 30.00, 'Noite de Gala de Ópera', 'Um espetáculo deslumbrante de ópera que combina música clássica, figurinos elegantes e performances emocionantes. Uma noite de elegância e cultura.', 'Música', '20:00:00', '2024-09-02'),
	(8, 35.50, 'Feira de Gastronomia Internacional', 'Sabores de todo o mundo se encontram nesta feira gastronómica internacional. Chefs renomados preparam pratos autênticos, proporcionando uma experiência culinária única.', 'Gastronomia', '12:00:00', '2024-04-11'),
	(9, 22.00, 'Maratona de Filmes Cult', 'Um dia inteiro dedicado aos filmes cult, exibindo clássicos e filmes independentes. Um evento imperdível para os amantes do cinema alternativo.', 'Cinema', '10:00:00', '2024-07-28'),
	(10, 28.50, 'Concerto de Rock Sinfónico', 'Uma fusão épica de rock e música sinfónica. Acompanhado por uma orquestra completa, este concerto leva os clássicos do rock a novas alturas.', 'Música', '21:30:00', '2024-11-15'),
	(10, 00.00, 'Exposição de Fotografia Contemporânea', 'Uma coleção fascinante de fotografias contemporâneas de artistas emergentes e estabelecidos. Cada imagem conta uma história única e provocativa.', 'Fotografia', '17:00:00', '2024-08-29'),
	(12, 26.00, 'Competição de Dança Latina', 'Dançarinos talentosos competem em uma variedade de estilos de dança latina, incluindo salsa, bachata e merengue. Uma explosão de ritmo e paixão.', 'Dança', '19:30:00', '2024-02-18'),
	(13, 19.99, 'Feira de Livros Antigos', 'Uma oportunidade para os amantes da literatura explorarem e adquirirem livros antigos e raros. Palestras de especialistas em livros também fazem parte do evento.', 'Literatura', '11:00:00', '2024-03-05'),
	(14, 27.50, 'Exposição de Carros Clássicos', 'Uma exibição de carros clássicos e icónicos de diferentes épocas. Os entusiastas de automóveis podem apreciar a beleza e a história destes veículos vintage.', 'Automóveis', '15:00:00', '2024-12-10'),
	(14, 24.75, 'Festival de Dança Contemporânea', 'Uma celebração da dança contemporânea com performances emocionantes e coreografias inovadoras. Bailarinos talentosos expressam-se através do movimento.', 'Dança', '18:00:00', '2024-09-21'),
	(13, 45.00, 'Experiência de Realidade Virtual', 'Um evento pioneiro que mergulha os participantes em experiências de realidade virtual imersivas. Desde jogos até simulações educativas, uma jornada virtual emocionante.', 'Tecnologia', '13:45:00', '2024-04-02'),
	(2, 21.75, 'Concerto Acústico no Jardim', 'Uma tarde relaxante de música acústica em um ambiente de jardim encantador. Artistas talentosos proporcionam uma experiência íntima e acolhedora.', 'Música', '16:30:00', '2024-07-14'),
	(1, 26.50, 'Festival de Balões de Ar Quente', 'O céu se enche de cores vibrantes com este festival de balões de ar quente. Um espetáculo visual encantador que atrai visitantes de todas as idades.', 'Eventos ao Ar Livre', '06:00:00', '2024-10-05'),
	(6, 18.25, 'Competição de Jogos de Tabuleiro', 'Jogadores habilidosos competem em uma variedade de jogos de tabuleiro estratégicos. Um evento divertido para entusiastas de jogos e estratégia.', 'Jogos', '14:00:00', '2024-05-30'),
	(7, 28.99, 'Conferência de Ciência e Inovação', 'Cientistas e inovadores compartilham descobertas e insights nas últimas tendências científicas. Palestras, painéis e exposições interativas.', 'Ciência', '09:30:00', '2024-11-28'),
	(15, 24.25, 'Noite de Stand-up Comedy', 'Uma noite cheia de risos com comediantes renomados que apresentam seus melhores números de stand-up. Prepare-se para uma experiência hilariante.', 'Comédia', '20:30:00', '2024-06-02'),
	(16, 18.50, 'Exibição de Fogos de Artifício', 'Um espetáculo pirotécnico deslumbrante que ilumina o céu noturno com cores vibrantes e padrões fascinantes. Uma celebração visual para toda a família.', 'Eventos ao Ar Livre', '21:00:00', '2024-07-04'),
	(17, 26.00, 'Festival de Jazz ao Ar Livre', 'Música de jazz ao ar livre em um ambiente descontraído. Artistas locais e internacionais se apresentam, criando uma atmosfera única para os amantes do jazz.', 'Música', '17:30:00', '2024-08-20'),
	(18, 19.75, 'Feira de Artesanato Local', 'Artesãos locais exibem e vendem suas obras únicas e artesanais. Uma oportunidade para os visitantes apreciarem a criatividade local e adquirirem peças exclusivas.', 'Artesanato', '11:00:00', '2024-09-12'),
	(19, 24.50, 'Campeonato de Basquete', 'Equipes de basquete de alto nível competem em um emocionante campeonato. Testemunhe a habilidade e a estratégia em ação enquanto os jogadores disputam pelo título de campeão.', 'Esportes', '15:00:00', '2024-07-30'),
	(20, 23.99, 'Festival de Música Eletrônica', 'Um festival eletrizante com DJs renomados e artistas de música eletrônica. Luzes pulsantes, batidas envolventes e uma atmosfera vibrante.', 'Música', '22:00:00', '2024-10-18'),
	(20, 16.99, 'Feira de Produtos Sustentáveis', 'Empresas e empreendedores locais apresentam produtos ecológicos e sustentáveis. Uma oportunidade para apoiar práticas amigáveis ao meio ambiente.', 'Sustentabilidade', '12:30:00', '2024-11-05'),
	(15, 28.75, 'Festival de Cinema ao Ar Livre', 'Filmes populares exibidos sob as estrelas em um ambiente ao ar livre. Uma experiência cinematográfica única para cinéfilos de todas as idades.', 'Cinema', '19:45:00', '2024-08-08'),
	(16, 22.80, 'Noite de Poesia e Café', 'Poetas locais e escritores apresentam suas obras em uma atmosfera aconchegante de café. Uma noite inspiradora para os amantes da poesia.', 'Literatura', '19:00:00', '2024-09-28'),
	(17, 19.25, 'Exposição de Esculturas em Ferro', 'Uma coleção de esculturas impressionantes feitas de ferro. Artistas contemporâneos exploram a versatilidade deste material em formas artísticas únicas.', 'Arte', '14:00:00', '2024-12-03');
